import s from './nav-bar.module.css'
import {NavLink} from "react-router-dom";

const ToolBar = (props) => {
    return (
        <div className={s.item}>
            <NavLink to={props.address} className = { navData => navData.isActive ? s.activeLink : s.item }>{props.name}</NavLink>
        </div>
    );
};

export default ToolBar;
